(86, 5, '\r\n\r\n\r\n\r\n\r\n<p><strong><span style="color: #ff00ff;">LA PRESENTE COTIZACI&Oacute;N CUMPLE, AUNQUE CON ALGUNAS DESVIACIONES, MISMAS QUE DESCRIBIMOS EN ESTA NOTA. </span></strong></p>\r\n<p><strong><span style="color: #ff00ff;">1.- LAS PLACAS DE LOS POSTES DEBEN DE SER DE 450 X 450mm Y NO DE 350 X 350mm. PUES LA DISTANCIA ENTRE CENTRO DE LOS BARRENOS ES DE 320mm., LAS ANCLAS SON DE 1" DE &Oslash;, POR 1.00 METRO DE LONGITUD, TODO ES TERMINADO EN GALVANIZADO POR INMERSI&Oacute;N EN CALIENTE, DE LOS 71 POSTES, 43 LLEVAR&Iacute;A PERCHA PARA RECIBIR EL BRAZO TIPO "C" Y 28 CON ESPIGA DE 3" DE &Oslash; NOMINAL, PARA RECIBIR LA CRUCETA DOBLE.</span></strong></p>\r\n<p><strong><span style="color: #ff00ff;">2.- LOS LUMINARIOS TIPO OV-15, NO LLEVAN BASE NI FOTOCELDA, PORQUE NO LO INDICAN EN LA DESCRIPCI&Oacute;N NI EN EL N&deg; DE CAT&Aacute;LOGO.</span></strong></p>\r\n<p><strong><span style="color: #ff00ff;">3.- LOS LUMINARIOS HALCONES, LLEVAR&Iacute;AN R&Oacute;TULA DENTADA, EN LUGAR DE LA HORQUILLA Y EL ADITAMENTO QUE SE USABA ANTES.</span></strong></p>\r\n<p>&nbsp;</p>\r\n\r\n'),
