(1, 1, 274, '1', 3, 'PZA.', 'AL-EG-40-165', '<!DOCTYPE html>\r\n<html>\r\n<head>\r\n</head>\r\n<body>\r\n<p>Conjunto de sistema de iluminaci&oacute;n solar. El sistema de iluminaci&oacute;n solar estar&aacute; conformado por los siguientes elementos: 1 Panel monocristalino de alta eficiencia de 160 watts, 1 bater&iacute;a grado solar tipo AGM Grupo U1 DE 111 A/Hr., totalmente sellada libre de mantenimiento. Con garant&iacute;a de funcionamiento m&iacute;nimo de 5 a&ntilde;os y vida &uacute;til no menor a 1,8 ciclos continuos. El conjunto debe evitar el uso de un inversor para no provocar perdidas en la eficiencia del sistema, se deber&aacute; presentar un informe con sus respectivos datos del (los) fabricante(s), demostrando una eficiencia superior al 76% en todo el conjunto. El conjunto debe permitir diferentes perfiles de operaci&oacute;n, como programaci&oacute;n de horarios, atenuaci&oacute;n y amaneceranochecer sin necesidad de fotoceldas. El sistema de gesti&oacute;n de energ&iacute;a, deber&aacute; permitir controlar la carga de la bater&iacute;a, control de des conexi&oacute;n por falta de carga, sobrecarga y/o corto circuito, deber&aacute; estar provisto con un fusible de 10 Amps. 1 Luminario a base de 3 LEDs de alto brillo 5700 grados Kelvin de generaci&oacute;n 4 o superior, sistema de disipaci&oacute;n de calor a base de extruido de aluminio, con tapa frontal y caja de conexiones, el luminario deber&aacute; excluir la necesidad de un driver electr&oacute;nico de corriente alterna, para minimizar</p>\r\n</body>\r\n</html>', 24000, 72000, '1'),
