(1, 1, 288, '1', 21, 'PZA.', 'BLM-EG145-T5-RDM-DD-AVM', '<!DOCTYPE html>\r\n<html>\r\n<head>\r\n</head>\r\n<body>\r\n<p>Sistema de iluminaci&oacute;n con tecnolog&iacute;a Led, por medio de energ&iacute;a solar,<br />incluye: Un panel fotovoltaico a base c&eacute;lulas de silicio monocristalino de alta eficiencia, de 160W cada uno (67.4 cm X 148.2 cm.); bater&iacute;as grado solar tipo AGM, grupo G-31, totalmente selladas, libres de mantenimiento, con garant&iacute;a de funcionamiento m&iacute;nimo de 5 a&ntilde;os.<br />El conjunto debe evitar el uso de un inversor para no provocar p&eacute;rdidas en la eficiencia del sistema, el cableado debe cumplir la norma NEC solar. El sistema de gesti&oacute;n de energ&iacute;a deber&aacute; permitir controlar la carga de las bater&iacute;as, controlar la desconexi&oacute;n por falta de carga, sobre carga y/o<br />corto circuito; deber&aacute; estar previsto de un fusible de 20Ampers, As&iacute; como diferentes perfiles de operaci&oacute;n, programaci&oacute;n de horarios, atenuaci&oacute;n y amanecer-anochecer sin la necesidad de fotoceldas, incluye control remoto inal&aacute;mbrico v&iacute;a RF (Por proyecto), respaldo de operaci&oacute;n de 2.9 d&iacute;as, para la regi&oacute;n con la que se dimension&oacute; el sistema, que fue Ixtapan del Oro.<br />Luminario a base de leds de alto brillo, 5700&deg;K , para proporcionar una curva tipo II IES. El conjunto en s&iacute; deber&aacute; cubrir el grado de protecci&oacute;n IP65.<br />Braquet de acero galvanizado por inmersi&oacute;n en caliente con una Cubierta plastica fabricada en policarbonato para alojar las bater&iacute;a. Dos soportes fabricados en acero galvanizado por inmersi&oacute;n en caliente para la colocaci&oacute;n de los paneles, tornilleria en acero galvanizado. El sistema BLM-EG145 deber&aacute; ser montado en la punta del poste en su totalidad para evitar que la piezas queden expuestas al vandalismo.</p>\r\n</body>\r\n</html>', 2113, 44373, '1'),
