imiento de pintura poli&eacute;ster para una mayor durabilidad. El luminario deber&aacute; contar con montaje a brazo mediante mecanismo a dos pernos ajustables de 1- 1/4 de pulgada a 2 pulgadas de di&aacute;metro (1-5/8" a 2-3/8" de di&aacute;metro exterior) y con un escudo integrado en la misma fundici&oacute;n de la carcasa para proteger el luminario de la fauna silvestre. El luminario deber&aacute; contar con un foto control de estado s&oacute;lido de tres pines tipo NEMA twist lock.</p>\r\n</body>\r\n</html>', 163, 926329, '1'),
(1, 1, 330, '1', 21, 'PZA.', ' BLMEG345-DD-XSPR-T2-DD-S-AVM', '<!DOCTYPE html>\r\n<html>\r\n<head>\r\n</head>\r\n<body>\r\n<p>El sistema de iluminaci&oacute;n solar estar&aacute; conformado por los siguientes elementos: Panel de silicio de alta eficiencia de 160watts.</p>\r\n<p>1 bater&iacute;as grado solar tipo AGM Grupo 31 totalmente sellada libres de mantenimiento. El conjunto debe evitar el uso de un inversor para no provocar perdidas en la eficiencia del sistema, se deber&aacute; presentar un informe con sus respectivos datos del (los) fabricante(s), demostrando una eficiencia superior al 76% en todo el conjunto.</p>\r\n<p>El conjunto debe permitir diferentes perfiles de operaci&oacute;n, como programaci&oacute;n de horarios, atenuaci&oacute;n y anochecer-amancer sin necesidad de fotoceldas. El sistema de gesti&oacute;n de energ&iacute;a, deber&aacute; permitir controlar la carga de las bater&iacute;as, control desconeci&oacute;n por falta de carga, sobrecarga y/o corto circuito, deber&aacute; estar provisto con un fusible de 10 Amps. Un Luminario Solar mca. Cree 2,619 lumens A base de leds de alto brillo 4000 grados Kelvin de generaci&oacute;n 4 o superior, sistema de disipaci&oacute;n de calor a base de aluminio, caja de conexiones, el luminaria deber&aacute; excluir la necesidad de un driver electr&oacute;nico de corriente alterna, para minimizar las perdidas del sistema.</p>\r\n<p>El sistema &oacute;ptico del luminaria deber&aacute; estar conformado por lentes refractivos de alta precisi&oacute;n y &oacute;pticas selladas , curva tipo II, El conjunto en si deber&aacute; cubrir los par&aacute;metros IP68, para las partes vulnerables, deber&aacute; tener ventilaci&oacute;n por conveccion en el conjunto de bater&iacute;as y se proveer&aacute; de un accesorio tipo bisagra para el panel, cuando se requiera alg&uacute;n mantenimiento.</p>\r\n<p>Incluye poste poste conico circular de 6.00 mts. De altura en calibre 11 en color rojo primer , juego de 4 anclas 60 cms. De longitud 3/4" de diametro y brazo de 1.20 mts. De longitud y 1 1/2" en color rojo primer.</p>\r\n<p>El soporte del conjunto solar deber&aacute; ser montado en la punta del poste en su totalidad, para evitar que las piezas queden expuestas.</p>\r\n<p>El fabricante del conjunto deber&aacute; demostrar ser un miembro reconocido de la IESNA.</p>\r\n<p>El conjunto solar deber&aacute; poder programarse v&iacute;a RF, con un control remoto alambico infrarrojo. El fabricante del conjunto, deber&aacute; poder soportar que el dise&ntilde;o fue calculado para 3.3 d&iacute;as de respaldo, seg&uacute;n su ubicaci&oacute;n geogr&aacute;fica, as&iacute; como el historial climatologico y meteorol&oacute;gico de la regi&oacute;n con la que se dimensiono el sistema.</p>\r\n<p>Este sistema se dise&ntilde;ado de acuerdo a la zona geogr&aacute;fica de ESTADO DE MEXICO MCA. CARMANAH.</p>\r\n</body>\r\n</html>', 60453.9, 1269530, '1'),
