(1, 1, 348, '1', 6, 'PZA.', 'ULAL160XP23I IDD', '<!DOCTYPE html>\r\n<html>\r\n<head>\r\n</head>\r\n<body>\r\n<p>Sistema de iluminaci&oacute;n con tecnolog&iacute;a Led, por medio de energ&iacute;a solar,<br />incluye: 1 paneles fotovoltaicos a base c&eacute;lulas de silicio monocristalino de alta eficiencia, de 160W cada uno (148.2 cm X 67.4 cm.); 1 bater&iacute;as grado solar, totalmente selladas, libres de mantenimiento, con garant&iacute;a de funcionamiento m&iacute;nimo de 1 a&ntilde;os.<br />El conjunto debe evitar el uso de un inversor para no provocar p&eacute;rdidas en la eficiencia del sistema, el cableado debe cumplir la norma NEC solar. El sistema de gesti&oacute;n de energ&iacute;a deber&aacute; permitir controlar la carga de las bater&iacute;as, controlar la desconexi&oacute;n por falta de carga, sobre carga y/o corto circuito; deber&aacute; estar previsto de un fusible de 30Ampers, As&iacute; como diferentes perfiles de operaci&oacute;n, programaci&oacute;n de horarios, atenuaci&oacute;n y amanecer-anochecer sin la necesidad de fotoceldas, incluye control remoto<br />inal&aacute;mbrico v&iacute;a RF (Por proyecto), respaldo de operaci&oacute;n de 3.2 d&iacute;as, para la regi&oacute;n con la que se dimension&oacute; el sistema, que fue Hermosillo Sonora.<br />Luminario a base leds de 23 Watts de alto brillo, 5700&deg;K , para proporcionar una curva tipo II IES. El conjunto en s&iacute; deber&aacute; cubrir el grado de protecci&oacute;n IP65. Debe incluir accesorios para montaje:<br />Braquet de acero galvanizado por inmersi&oacute;n en caliente para alojar la bater&iacute;a. Dos soportes fabricados en acero galvanizado por inmersi&oacute;n en caliente para la colocaci&oacute;n de los paneles, tornilleria en acero galvanizado.<br />El sistema deber&aacute; ser montado en la punta del poste en su totalidad para evitar que las piezas queden expuestas al vandalismo. Marca: UNION LIGHTING.</p>\r\n</body>\r\n</html>', 1397, 8382, '1'),
