(1, 1, 389, '1', 40, 'PZA.', 'AL EG320 E DD ATB0 R3 ALX1 AVM', '<!DOCTYPE html>\r\n<html>\r\n<head>\r\n</head>\r\n<body>\r\n<p>Sistema de iluminaci&oacute;n con tecnolog&iacute;a Led, por medio de energ&iacute;a solar,<br />incluye: 1 paneles fotovoltaicos a base c&eacute;lulas de silicio monocristalino de alta eficiencia, de 230W cada uno (157.5 cm X 82.6 cm.); 2 bater&iacute;as grado solar tipo AGM, grupo G-27, totalmente selladas, libres de mantenimiento, con garant&iacute;a de funcionamiento m&iacute;nimo de 5 a&ntilde;os. El conjunto debe evitar el uso de un inversor para no provocar p&eacute;rdidas en la eficiencia del sistema, el cableado debe cumplir la norma NEC solar. El sistema de gesti&oacute;n de energ&iacute;a deber&aacute; permitir controlar la carga de las bater&iacute;as, controlar la desconexi&oacute;n por falta de carga, sobre carga y/o corto circuito; deber&aacute; estar previsto de un fusible de 30Ampers, As&iacute; como diferentes perfiles de operaci&oacute;n, programaci&oacute;n de horarios, atenuaci&oacute;n y amanecer-anochecer sin la necesidad de fotoceldas, incluye control remoto inal&aacute;mbrico v&iacute;a RF (Por proyecto), respaldo de operaci&oacute;n de 3.3 d&iacute;as, para la regi&oacute;n con la que se dimension&oacute; el sistema, que fue MEXICO D.F.<br />Luminario a base de Led`s de alto brillo, 5700&deg;K , para proporcionar 5,340 lumens y una curva tipo III IES. El conjunto en s&iacute; deber&aacute; cubrir el grado de protecci&oacute;n IP65.<br />Poste metalico de 6 metros de altura secci&oacute;n c&oacute;nico circular fabricado en lamina de acero cal. 3/16 galvanizado por inmersi&oacute;n en caliente (LAPEM), Brazo de 1 1/2&rdquo; de diametro por 1.20 m. de largo en acero galvanizado por inmersi&oacute;n en caliente, Juego de 4 anclas de 1&rdquo; de diametro por 1 m. de largo en acero galvanizado por inmersi&oacute;n en caliente Debe incluir accesorios para montaje:<br />Braquet de acero galvanizado por inmersi&oacute;n en caliente con una tina fabricada en policarbonato para alojar las bater&iacute;as. Dos soportes fabricados en acero galvanizado por inmersi&oacute;n en caliente para la colocaci&oacute;n de los paneles, tornilleria en acero galvanizado.<br />El sistema BLM-EG 320 deber&aacute; ser montado en la punta del poste en su totalidad para evitar que las piezas queden expuestas al vandalismo. Marca: ALSA-CARMANAH.</p>\r\n</body>\r\n</html>', 2495, 99800, '1'),
