(1, 1, 439, ' 1', 56, 'PZA.', 'BLM EG320 T3 XSP DD 5LED AVM', '<!DOCTYPE html>\r\n<html>\r\n<head>\r\n</head>\r\n<body>\r\n<p>Sistema de iluminaci&oacute;n con tecnolog&iacute;a Led, por medio de energ&iacute;a solar,<br />incluye: 1 paneles fotovoltaicos a base c&eacute;lulas de silicio monocristalino de alta eficiencia, de 230W cada uno (157.5 cm X 82.6 cm.); 2 bater&iacute;as grado solar tipo AGM, grupo G-27, totalmente selladas, libres de mantenimiento, con garant&iacute;a de funcionamiento m&iacute;nimo de 5 a&ntilde;os. El conjunto debe evitar el uso de un inversor para no provocar p&eacute;rdidas en la eficiencia del sistema, el cableado debe cumplir la norma NEC solar. El sistema de gesti&oacute;n de energ&iacute;a deber&aacute; permitir controlar la carga de las bater&iacute;as, controlar la desconexi&oacute;n por falta de carga, sobre carga y/o corto circuito; deber&aacute; estar previsto de un fusible de 30Ampers, As&iacute; como diferentes perfiles de operaci&oacute;n, programaci&oacute;n de horarios, atenuaci&oacute;n y amanecer-anochecer sin la necesidad de fotoceldas, incluye control remoto inal&aacute;mbrico v&iacute;a RF (Por proyecto), respaldo de operaci&oacute;n de 3.3 d&iacute;as, para la regi&oacute;n con la que se dimension&oacute; el sistema, que fue Sahagun.<br />Luminario a base de Led`s de alto brillo, 5700&deg;K , para proporcionar 4,766 lumens y una curva tipo III IES. El conjunto en s&iacute; deber&aacute; cubrir el grado de protecci&oacute;n IP65. Poste metalico de 6 metros de altura secci&oacute;n c&oacute;nico circular fabricado en lamina de acero cal. 3/16 galvanizado por inmersi&oacute;n en caliente (LAPEM), Brazo de 1 1/2&rdquo; de diametro por 1.20 m. de largo en acero galvanizado por inmersi&oacute;n en caliente, Juego de 4 anclas de 1&rdquo; de diametro por 1 m. de largo en acero galvanizado por inmersi&oacute;n en caliente Debe incluir accesorios para montaje:<br />Braquet de acero galvanizado por inmersi&oacute;n en caliente con una tina fabricada en policarbonato para alojar las bater&iacute;as. Dos soportes fabricados en acero galvanizado por inmersi&oacute;n en caliente para la colocaci&oacute;n de los paneles, tornilleria en acero galvanizado.<br />El sistema BLM-EG 320 deber&aacute; ser montado en la punta del poste en su totalidad para evitar que las piezas queden expuestas al vandalismo. Marca: BLM-CARMANAH.</p>\r\n</body>\r\n</html>', 2524, 141344, '1'),
(1, 1, 440, '1', 3, 'PZA.', 'PDC 30 6 CC10L+XAK U A 24 E U S X', '<!DOCTYPE html>\r\n<html>\r\n<head>\r\n</head>\r\n<body>\r\n<p>SISTEMA COMPUESTO POR: POSTE TYPSA DE SECCI&Oacute;N DODECAGONAL TIPO C&Oacute;NICO PARA ALUMBRADO P&Uacute;BLICO Y SERVICIO A LA INTERPERIE DE 30 MTS. DE ALTURA CONSTRUIDO EN 3 SECCIONES ENCHUFABLES, EN PLACA DE ACERO DE ALTA RESISTENCIA ROLADA EN FR&Iacute;O CALIBRE 1/4&rdquo;, TRANSVERSALMEMENTE NO LLEVAR&Aacute; COSTURA, SOLDADURA, EMPALME, BRIDA O REMACHE DE UNI&Oacute;N ALGUNA EN TODA SU LOGINTUD, SOLDADURA PERMISIBLE: LONGITUDINAL, CON PENETRACI&Oacute;N AL 100% EXENTE DE BURBUJAS, CON PLACA BASE DE 830 X 830MM&nbsp; Y UN ESPESOR DE 2&rdquo;, CON 12 BARRENOS PARA ANCLAS QUE SE INCLUYEN DE 2&rdquo; X 2.0MTS. CON 2 TUERCAS POR ANCLA, CON ANILLO DE REFUERZO Y CARATABONES, UNI&Oacute;NPLACABASE-POSTE;&nbsp; CON REGISTRO PARA CONEXIONES UBICADO A 60CMS DE LA BASE, INCLUYE CORONA DE ACERO ESTRUCTURAL PARA SOPORTAR 10 LUMINARIOS.MODELO XAKDA CON ESCALONES DESMONTABLES TIPO CFE ACABADO EN GALVANIZADO POR INMERSI&Oacute;N EN CALIENTE, LUZ DE OBSTRUPCION.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; LUMINARIO&nbsp;&nbsp; PARA USO EXTERIOR, FABRICADO CON ARMADURA DE FUNDICION DE ALUMINIO, TRATADO MEDIANTE PRODUCTOS QUIMICOS PARA ELIMINAR HUELLAS DE GRASA, ASI COMO UNA PELICULA DE FOSFATO DE FIERRO PARA EVITAR LA PREMATURA OXIDACION Y AUMENTAR EL ANCLAJE DE LA PINTURA; PINTADO CON RESINA, POLIESTER EN POLVO, COLOR GRIS , APLICADA MEDIANTE PROCESO ELECTROSTATICO Y SECADO AL HORNO, LA ADHERENCIA DE LA PINTURA DEBERA CUMPLIR CON LA NORMA DIN-53151, CON TECNOLOGIA LED COMPUESTO DE 240 LEDs A 5700 &deg;K OPERANDO A 1000 mA. EL DRIVERS AUTORREGULADO DE ALTO FACTOR DE POTENCIA DE A 120 A 277 V.C.A., 60 HZ.</p>\r\n</body>\r\n</html>', 47862, 143586, '1'),
