(2, 2, 194, '2', 2, 'PZA.', 'BLM-EG320-T2L-XSP1-DD-D-AVM', '<!DOCTYPE html>\r\n<html>\r\n<head>\r\n</head>\r\n<body>\r\n<p>Sistema de iluminaci&oacute;n con tecnolog&iacute;a Led, por medio de energ&iacute;a solar,<br />incluye: 1 paneles fotovoltaicos a base c&eacute;lulas de silicio&nbsp; monocristalino de alta eficiencia, de 230W cada uno (82.6 cm X 157.7 cm.);&nbsp; 2 bater&iacute;as grado solar tipo AGM, grupo G-27, totalmente selladas, libres de mantenimiento, con garant&iacute;a de funcionamiento m&iacute;nimo de 5 a&ntilde;os.<br />&nbsp;El conjunto&nbsp; debe evitar&nbsp; el uso de un inversor&nbsp; para no provocar p&eacute;rdidas&nbsp; en la eficiencia del sistema, el cableado debe cumplir la norma NEC solar. El sistema de gesti&oacute;n de energ&iacute;a deber&aacute; permitir controlar la carga de las bater&iacute;as, controlar la desconexi&oacute;n por falta de carga, sobre carga y/o corto circuito; deber&aacute; estar previsto de un fusible de 30Ampers, As&iacute; como diferentes perfiles de operaci&oacute;n, programaci&oacute;n de horarios, atenuaci&oacute;n y amanecer-anochecer sin la necesidad de fotoceldas, incluye control remoto inal&aacute;mbrico v&iacute;a RF (Por proyecto), respaldo de operaci&oacute;n de 3.1 d&iacute;as, para la regi&oacute;n con la que se dimension&oacute; el sistema, que fue M&eacute;xico D.F.<br />Dos Luminario a base de leds de alto brillo, 5700&deg;K , para proporcionar 2,246 lumens y una curva tipo II IES. El conjunto en s&iacute; deber&aacute; cubrir el grado de protecci&oacute;n IP65.<br />Completo con accesorios para montaje:<br />Braquet&nbsp; de acero galvanizado&nbsp; por inmersi&oacute;n en caliente con una tina fabricada en policarbonato para&nbsp; alojar las bater&iacute;as. Dos soportes fabricados en acero&nbsp; galvanizado&nbsp; por inmersi&oacute;n en caliente para la colocaci&oacute;n de los paneles, tornilleria en acero&nbsp; galvanizado.<br />El sistema BLM-EG320 deber&aacute; ser montado en la punta del poste en su totalidad para evitar que las piezas queden expuestas al vandalismo. Marca: BLM-CARMANAH</p>\r\n</body>\r\n</html>', 5049, 10098, '1'),
