(3, 3, 329, '3', 5, 'PZA.', 'ATBS72', '<!DOCTYPE html>\r\n<html>\r\n<head>\r\n</head>\r\n<body>\r\n<p>Suministro de luminaria para alumbrado vial con tecnolog&iacute;a LED de 72 Watts de 1&nbsp; chip con flujo luminoso inicial m&iacute;nimo de 6,249 lumenes con una fuente&nbsp; electr&oacute;nica y una eficiencia m&iacute;nima de 87 lm/W con una temperatura de color correlacionada promedio (CCT) de 4000k con un &iacute;ndice de reproducci&oacute;n crom&aacute;tica (CRI) m&iacute;nimo de 70, con un grado de protecci&oacute;n IP66 con &oacute;ptica de vidrio de borosilicato para garantizar la longevidad y minimizar la depreciaci&oacute;n por suciedad, la luminaria deber&aacute; operar a un rango de voltaje de 120 a 277 volts, el luminario deber&aacute; cumplir con los criterios NEMA Full Cutoff, limitando contribuci&oacute;n de luz hacia atr&aacute;s del luminario con curva de distribuci&oacute;n tipo NEMA tipo II, los componentes el&eacute;ctricos deber&aacute;n ser de alta durabilidad con m&oacute;dulo&nbsp; de led con una vida mayor a 100,000 horas a 25&deg; C, L70, y la fuente electr&oacute;nica deber&aacute; tener una vida nominal m&iacute;nima de 100,000 a 25&deg; c. el luminario deber&aacute; contar con un supresor de picos con una capacidad de 10KV/5KA categor&iacute;a, el luminario deber&aacute; ser de f&aacute;cil mantenimiento el cual deber&aacute; contar con acceso libre de herramientas, con apertura a trav&eacute;s de un sujetador tipo mariposa roscado&nbsp; que de acceso al m&oacute;dulo el&eacute;ctrico, el luminario deber&aacute; contar con bloque de terminales, conectores r&aacute;pidos localizados dentro del compartimiento el&eacute;ctrico para f&aacute;cil instalaci&oacute;n. La armadura del luminario deber&aacute; ser de fundici&oacute;n de aluminio de 23.75 pulgadas de largo, 11 pulgadas de ancho y 4.5 pulgadas de alto con un EPA m&aacute;ximo de 0.6&nbsp; pies cuadrados y un peso m&aacute;ximo de 5 Kg, con disipadores de calor con recubrimiento de pintura poli&eacute;ster para una mayor durabilidad. El luminario deber&aacute; contar con montaje a brazo mediante mecanismo a dos pernos ajustables de 1- 1/4 de pulgada a 2 pulgadas de di&aacute;metro (1-5/8" a 2-3/8" de di&aacute;metro exterior) y con un escudo integrado en la misma fundici&oacute;n de la carcasa para proteger el luminario de la fauna silvestre. El luminario deber&aacute; contar con un foto control de estado s&oacute;lido de tres pines tipo NEMA twist lock.</p>\r\n</body>\r\n</html>', 200, 1000, '1'),
